import './App.css';
import DataApi from './Components/DataApi';
import Logo from './Components/Logo';
import Navbar from './Components/Navbar';
import SearchBox from './Components/SearchBox';

function App() {
  return (
    <div className="App">
        <Logo/>
        <SearchBox/>
        <Navbar/>
        <DataApi title="avi"/>
    </div>
  );
}

export default App;
